	(27, '2025-01-23 23:06:00', 4, '<p><strong>ESTADO DE PROYECTOS ACTUALES.</strong></p><ol><li><strong>COSISE</strong>. Sin información actualizada, proyecto listo para producción. Ultima información, realizada por Jaibey.</li><li><strong>DINAMIC.</strong>&nbsp;Se realizó la visita con solicitud de ajuste, se realizó los ajustes, todavía hay validaciones por realizar por parte del cliente para salir a producción.</li><li><strong>HEPAR.</strong> Ultima información su gerente está de vacaciones, pendiente de entregar 1 implementación de reporte (Implementación cotizada, pendiente de pago), 3 tickets cotizados mediante correo sin aprobación para subir a desarrollo.</li><li><strong>CONFERRZA.</strong>&nbsp;Reunión con Jaibey, pendiente de reunión con Genaro en sus oficinas para el día viernes 17/01, para definir comercialmente.</li><li><strong>JATSA.</strong>&nbsp;Sin información actualizada.</li><li><strong>DELOB.</strong>&nbsp;Pendiente de revisar e implementar su segunda membresía.</li><li><strong>W &amp; P.</strong>&nbsp;Sin información actualizada.</li><li><strong>ALKHA &amp; CIA.</strong> Ya se encuentra en producción, Se implementó los módulos tickets cotizados, Módulos de ORDEN DE SERVICIO PROVEEDOR (vinculados a liquidación de terceros), se implementó que las solicitudes de caja con un check puedan ser declarados y liquidados tantos gastos operativos con gasto caja. Actualmente está implementando ticket para que los usuarios tengan supervisor y un cket de usuario gerente. Estos tendrán accesos a rango de ver la información. Pendiente de realizar seguimiento de las implementaciones posibles errores.</li><li><strong>JAEN COURIER.&nbsp;</strong>Sin información.<strong>&nbsp;</strong></li><li><strong>TRANSLAY.</strong> Solo se realizó cambios rápidos y salió a producción. Lo realizó seguimiento Isabel.</li><li><strong>HORADADA.</strong> Se implementó ajustes de detalles en impresión, y pendiente de revisar ticket de implementación de módulo FACTORIZACIÓN. Lo está realizando seguimiento Isabel.</li><li><strong>TRANSPORTES EL OLIVAR.</strong> Se registró ticket, revisar debería finalizar ticket martes 14/01.</li><li><strong>JLF SERVICIOS &amp; TRANSPORTES S.A.C.</strong> Se realizó la activación de su Link, pendiente primera reunión, Consultar a Isabel.</li><li><strong>TRANSPORTES RIVERA SIVANA HNOS. S.A.C - TRS HNOS. S.A.C.&nbsp;</strong>Cliente nuevo de ISABEL, recién enviado sus accesos.</li><li><strong>OPERADOR LOGISTICO PUCHOC EIRL.&nbsp;</strong>Recién pagó el sábado, generar coreo de activación de plataforma paquetería empresarial.</li></ol>', '<p><strong>ESTADO DE PROYECTOS ACTUALES.</strong></p><ol><li><strong>COSISE</strong>. Sin información actualizada, proyecto listo para producción. Ultima información, realizada por Jaibey.</li><li><strong>DINAMIC.</strong>&nbsp;Se realizó la visita con solicitud de ajuste, se realizó los ajustes, todavía hay validaciones por realizar por parte del cliente para salir a producción.</li><li><strong>HEPAR.</strong> Ultima información su gerente está de vacaciones, pendiente de entregar 1 implementación de reporte (Implementación cotizada, pendiente de pago), 3 tickets cotizados mediante correo sin aprobación para subir a desarrollo.</li><li><strong>CONFERRZA.</strong>&nbsp;Reunión con Jaibey, pendiente de reunión con Genaro en sus oficinas para el día viernes 17/01, para definir comercialmente.</li><li><strong>JATSA.</strong>&nbsp;Sin información actualizada.</li><li><strong>DELOB.</strong>&nbsp;Pendiente de revisar e implementar su segunda membresía.</li><li><strong>W &amp; P.</strong>&nbsp;Sin información actualizada.</li><li><strong>ALKHA &amp; CIA.</strong> Ya se encuentra en producción, Se implementó los módulos tickets cotizados, Módulos de ORDEN DE SERVICIO PROVEEDOR (vinculados a liquidación de terceros), se implementó que las solicitudes de caja con un check puedan ser declarados y liquidados tantos gastos operativos con gasto caja. Actualmente está implementando ticket para que los usuarios tengan supervisor y un cket de usuario gerente. Estos tendrán accesos a rango de ver la información. Pendiente de realizar seguimiento de las implementaciones posibles errores.</li><li><strong>JAEN COURIER.&nbsp;</strong>Sin información.<strong>&nbsp;</strong></li><li><strong>TRANSLAY.</strong> Solo se realizó cambios rápidos y salió a producción. Lo realizó seguimiento Isabel.</li><li><strong>HORADADA.</strong> Se implementó ajustes de detalles en impresión, y pendiente de revisar ticket de implementación de módulo FACTORIZACIÓN. Lo está realizando seguimiento Isabel.</li><li><strong>TRANSPORTES EL OLIVAR.</strong> Se registró ticket, revisar debería finalizar ticket martes 14/01.</li><li><strong>JLF SERVICIOS &amp; TRANSPORTES S.A.C.</strong> Se realizó la activación de su Link, pendiente primera reunión, Consultar a Isabel.</li><li><strong>TRANSPORTES RIVERA SIVANA HNOS. S.A.C - TRS HNOS. S.A.C.&nbsp;</strong>Cliente nuevo de ISABEL, recién enviado sus accesos.</li><li><strong>OPERADOR LOGISTICO PUCHOC EIRL.&nbsp;</strong>Recién pagó el sábado, generar coreo de activación de plataforma paquetería empresarial.</li></ol>', 1, '<p>ssss</p>', 2, 1, NULL),
